import './App.css';
import BlurryIcon from './assets/BlurryIcon.svg';
import ChatWindow from './components/ChatWindow';
import Navbar from './components/NavBar';

function App() {
  return (
    <div className="min-h-screen bg-bgPrimary text-white">
      <div className="pr-4 pl-4">
        <Navbar />
        <img
          src={BlurryIcon} // Use the imported image as the source
          alt="Blurry Icon"
          className="w-64 h-64 object-contain" // Tailwind classes for styling
        />
      </div>
      <div className="p-4 bg-'">
        <ChatWindow />
      </div>
    </div>
  );
}

export default App;
